import { Link } from "react-router-dom";

const ListItem = ({item}) => {
    const {id, Framing} = item;
    return(
        <Link to='OVERHEAD PLATE BOOK'> 
            <h2 value={Framing}key={id}>{Framing}</h2>
        </Link>

    )
}

export default ListItem;
